# + [markdown] id="qQJN1qVLF6LH"
# Designed for endurance athlethes, the [Coros Pace 2](https://coros.com/pace2) is a GPS-enabled smart watch that can track health parameters.
#
#
# We've used the Coros Pace 2 for a while now, and we'll show you how to extract its data, visualize heart rate data, and compute correlations and other statistical measures based on your data! While you will need a Garmin Fenix 7S to actually collect the data itself, the data *extraction* requires only an internet connection and your username and password.
#
# If you want to know more about the Coros Pace 2, see the [README](https://wearipedia.com/wearables/coros-pace-2) for a detailed analysis of performances, sensors, data privacy, and extraction pipelines.
#
# You can extract the parameters with known sampling frequencies as below:
#
# Parameter Name  | Sampling Frequency 
# -------------------|------------------
# Heart rate      |  Every 10 Mins
# VO2 max |  Daily
# Exercise Time |  Daily
# Steps | Every 10 Mins
# Sleep data | During Night time
#
# Additionally, the watch can get data per specific workout including the listed parameters
#
# Parameter Name  | Details 
# -------------------|------------------
# distance     |  Unit: meter
# calorie |  
# avgSpeed |  Unit: second/km
# avgFrequency | Unit: step/min
# step |
# startTime |  Count to second
# endTime |  Count to second
# startTimezone |  15-minute time zone system, 32 means UTC+08:00
# duration |  Unit: second
#
#
# In this guide, we sequentially cover the following **eight** topics to extract from the unofficial Coros API:
# 1. **Setup**
# 2. **Authentication and Authorization**
#     - Requires only username and password, no OAuth.
# 3. **Data Extraction**
#     - We get data via `wearipedia` in a couple lines of code.
# 4. **Data Exporting**
#     - We export all of this data to file formats 
# 5. **Adherence**
#     - We detect when the user isn't using the   device 
# 6. **Visualization**
#     - We create a simple plot to visualize our data.
# 7. **Advanced Visualization**
#     - 7.1: We visualize calories in a specific day
#     - 7.2: We visualize month's heart rate
# 8. **Outlier Detection and Data Cleaning**
#     - We detect outliers in our data and filter them out.
# 9. **Statistical Data Analysis**
#     - 9.1: We analyze the correlation between the maximum heart rate and the steps
#     - 9.2: We analyze the correlation between the average heart rate and the calories exerted
#
#
# Note that we are not making any scientific claims here as our sample size is small and the data collection process was not rigorously vetted (it is our own data), only demonstrating that this code could potentially be used to perform rigorous analyses in the future.
#
# Disclaimer: this notebook is purely for educational purposes. All of the data currently stored in this notebook is purely *synthetic*, meaning randomly generated according to rules we created. Despite this, the end-to-end data extraction pipeline has been tested on our own data, meaning that if you enter your own email and password on your own Colab instance, you can visualize your own *real* data. That being said, we were unable to thoroughly test the timezone functionality, though, since we only have one account, so beware.

