#fetch the data
hrdates = []
# average, max, and min heart rates
av = []
max = []
min = []
for i in json.loads(data["heart_rate"])["data"]["statisticData"]["dayDataList"]:
  hrdates.append(str(i["happenDay"]))
  av.append(i["heartRateData"]["avgHeartRate"])
  max.append(i["heartRateData"]["maxHeartRate"])
  min.append(i["heartRateData"]["minHeartRate"])

# invert the arrays
hrdates = hrdates[::-1]
av = av[::-1]
max = max[::-1]
min = min[::-1]

d = {'Date': hrdates, 'av': av}
df = pd.DataFrame(data=d)



with plt.style.context('dark_background'):

    #Resizing the plot
    fig,ax = plt.subplots()
    fig.set_size_inches(20,8)

    #Creating the plot      
    sns.set_theme(style="dark")
    ax = plt.plot(hrdates, av, marker = "s", color= "#727688", markerfacecolor="#e4007a", markeredgecolor="#e4007a")


    #background color
    fig.patch.set_facecolor('#181a30')
    plt.gca().set_facecolor('#181a30')

    #plotting the error lines. since seaborn version doesn't support it
    arr=[]
    for i in range(len(av)):
      arr.append(i)
    
    plt.vlines(x = arr, ymin = min, ymax = max, colors = '#e4007a', linewidth=3)


    # adjust tick sizes
    plt.tick_params(axis='x', labelsize=18)
    plt.tick_params(axis='y', labelsize=12)

    # change the y-labels to the right side 
    plt.gca().yaxis.tick_right()

    # put Y appropriate labels
    hr = [30, 95, 160, 225]
    labels = [30, 95, 160, 225]
    plt.yticks(ticks=hr, labels=labels, color = '#9a9eac')

    ## put appropriate X labels
    
    days_dict = {1:"Tue",2:"Wed",3:"Thu",4:"Fri",5:"Sat",6:"Sun",0:"Mon"}

    labels = []
    for i in hrdates:
      date_obj = datetime.date(int(i[0:4]), int(i[4:6]), int(i[6:8]))
